import { Store } from 'redux';
import { Provider } from 'react-redux';
import AfficherTab from './components/AfficherTab'
export default function App() {
  return (
    <div>
      <Provider store={store}>
        <AfficherTab/>
      </Provider>
    </div>
  )
}
